import React from 'react';
import { useDashboard } from '../context/DashboardContext';

const tokens = [
  {
    name: 'PAWPAW', icon: 'üê∂', volume: 115, risk: 'Low', meta: 'GambleFi', strategy: 'Smart Whale + GambleFi',
    winRate: 68, change: '+24.4%', priceColor: 'text-green-400'
  },
  {
    name: 'BABY BOB', icon: 'üê∏', volume: 134, risk: 'Low', meta: 'GambleFi', strategy: 'Volume Spike + Meme',
    winRate: 72, change: '+34.1%', priceColor: 'text-green-400'
  },
  {
    name: 'RUGPULL', icon: 'üí©', volume: 210, risk: 'High', meta: 'Meme', strategy: 'High Risk + Meme',
    winRate: 12, change: '-12.5%', priceColor: 'text-red-400'
  },
];

export default function TokenList() {
  const { selectedToken, setSelectedToken } = useDashboard();
  return (
    <div className="space-y-4">
      <h2 className="text-xl font-semibold mb-2">Pinged Tokens</h2>
      {tokens.map(token => {
        const riskColor = token.risk === 'High' ? 'bg-red-500/20 text-red-400' : 'bg-green-500/20 text-green-300';
        return (
          <div
            key={token.name}
            className={`card-wrapper p-3 hover:outline outline-blue-500 transition-all cursor-pointer ${selectedToken?.name === token.name ? 'outline-2 outline-indigo-500 scale-[1.02]' : ''}`}
            onClick={() => setSelectedToken(token)}
          >
            <div className="flex items-center gap-2">
              <span className="text-2xl">{token.icon}</span>
              <p className="font-bold">${token.name}</p>
              <span className={`badge ${riskColor}`}>{token.risk}</span>
            </div>
            <p className="text-sm text-gray-400">Vol: {token.volume}%</p>
            <p className="text-xs text-gray-500">Meta: {token.meta}</p>
            <p className="text-xs mt-2">Strategy: {token.strategy}</p>
            <div className="w-full bg-gray-700 rounded-full h-1 mt-1">
              <div className="bg-green-400 h-1 rounded-full" style={{ width: `${token.winRate}%` }}></div>
            </div>
            <p className={`text-xs mt-1 font-bold ${token.priceColor}`}>{token.change}</p>
          </div>
        );
      })}
    </div>
  );
}
